import {Link} from "react-router-dom";
import "./home.css"


const Home = () => {
  return (
    <div className="container-fluid text-center">
      <h1>Home</h1>
      <div className="button-container d-flex justify-content-evenly">
      <Link className="btn btn-secondary"to="/signup">Sign Up</Link>
      <Link className="btn btn-secondary"to="/login" rol="true">Log in como Veterinario</Link>
      <Link className="btn btn-secondary"to="/login" rol="false">Log in como Usuario</Link>
      </div>
    </div>
  )
}

export default Home;
